import { Component } from 'react';

import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monster1: {
        name: 'Linda'
      },
      monstar2: {
        name: 'Frank'
      },
      monstar3: {
        name: 'Jacky'
      }
    };

  }
  render() {
    return (
      <div className="App">
        <h1>{this.state.monstar1.name}</h1>
        <h1>{this.state.monstar2.name}</h1>
        <h1>{this.state.monstar3.name}</h1>

      </div>
    );
  }
}

export default App;
